import React, { Component } from "react";

export default class Produk extends Component {
    constructor() {
    super();
    this.state = {
      stock: "Uzumaki Naruto",
      age: 26,
      parent: [
        {
          name: "Minato Namikaze",
          age: 60,
        },
        {
          name: "Uzumaki Kushina",
          age: 58,
        },
      ],
    };
  }
  render() {
    return (
      <div className="box-stock">
        <h2>Nama Produk</h2>
        <img
          src="https://source.unsplash.com/640x480?random"
          alt="Technology"
        />
        <p>Harga</p>
        <p>Stok</p>
        <button className="btn-click">Beli</button>
        <p>Status</p>
      </div>
    );
  }
}
